        private void barcodeTxtbox_KeyDown(object sender, KeyEventArgs e)
        {
            if (e.KeyCode == Keys.Enter)
            {
                string scannedCode = barcodeTxtbox.Text.Trim();
                FetchProductData(scannedCode);
                barcodeTxtbox.Clear();
                e.SuppressKeyPress = true;
            }
        }
